BEGIN TRY

IF OBJECT_ID('Base_Counties_SSA_tmp') IS NOT NULL
DROP TABLE Base_Counties_SSA_tmp

SELECT bc.Name,bc.CountyFIPS,bc.CountySSA,bc.[State]
INTO Base_Counties_SSA_tmp
  FROM dbo.Base_Counties bc
WHERE 1=2

BEGIN

print 'Processed *total records'



























































END


UPDATE Base_counties 
SET CountySSA = bcst.CountySSA, [State] = bcst.[State]
FROM Base_counties a
Inner join Base_Counties_SSA_tmp bcst
ON a.Name=bcst.Name
AND a.CountyFIPS=bcst.CountyFIPS

	Name,
	CountyFIPS,
	CountySSA,
	[State]
)
SELECT
	bcst.Name,
	bcst.CountyFIPS,
	bcst.CountySSA,
	bcst.[State]
FROM
	Base_Counties_SSA_tmp bcst
WHERE NOT EXISTS ( SELECT 1 FROM Base_Counties bc
                   WHERE bc.Name=bcst.Name
                   AND bc.CountyFIPS=bcst.CountyFIPS)
                   
                   
IF OBJECT_ID('Base_Counties_SSA_tmp') IS NOT NULL
DROP TABLE Base_Counties_SSA_tmp

